#
# TABLE STRUCTURE FOR: HABITACION
#

DROP TABLE IF EXISTS `HABITACION`;

CREATE TABLE `HABITACION` (
  `ID_ESPACIO` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `TIPO` enum('INDIVIDUAL','DOBLE','TRIPLE','CUADRUPLE') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ES_SUITE` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ES_COMPARTIDO` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `BANHO_COMPARTIDO` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `TIENE_COCINA` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`ID_ESPACIO`),
  CONSTRAINT `HABITACION_ibfk_1` FOREIGN KEY (`ID_ESPACIO`) REFERENCES `ESPACIO_HOSPEDAJE` (`ID_ESPACIO`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



